import io
import sys
from unittest import TestCase

from Solutions.Codesprint2.Finished.Gridland import main


class TestSolution(TestCase):
    def test_initial_case(self):
        input_string = '''5
1
a
a
3
dab
abd
5
ababa
babab
26
abcdefghijklmnopqrstuvwxyz
abcdefghijklmnopqrstuvwxyz
600


'''

        result = '''1
8
2
652
359402
'''
        sys.stdin = io.StringIO(input_string)
        sys.stdout = io.StringIO()
        main()
        self.assertEqual(result, sys.stdout.getvalue())


    def test_case1(self):
        input_string = '''1
13
abcdefghijklm
zyxwvutsrqpon
'''

        result = '''316
'''
        sys.stdin = io.StringIO(input_string)
        sys.stdout = io.StringIO()
        main()
        self.assertEqual(result, sys.stdout.getvalue())

    def test_case2(self):
        input_string = '''1
6
abcdef
ghijkl
'''

        result = '''64
'''
        sys.stdin = io.StringIO(input_string)
        sys.stdout = io.StringIO()
        main()
        self.assertEqual(result, sys.stdout.getvalue())

    def test_case3(self):
        input_string = '''1
10
abcdefghij
klmnopqrst
'''

        result = '''184
'''
        sys.stdin = io.StringIO(input_string)
        sys.stdout = io.StringIO()
        main()
        self.assertEqual(result, sys.stdout.getvalue())

